import React, {Component} from 'react';
import { Button } from 'react-native';

import Profilescreen from './Profilescreen';
import Notification from './Notification';
import Sharescreen from './Sharescreen';
import Privatescreen from './Privatescreen';
import ScheduleScreen from './ScheduleScreen';
import Rootstackscreen from './Rootstackscreen';
import Icon from 'react-native-vector-icons/Ionicons';
import FontAwesome from 'react-native-vector-icons/FontAwesome';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import { DrawerContent } from './DrawerContent'


import {NavigationContainer} from '@react-navigation/native';
import {createDrawerNavigator} from '@react-navigation/drawer';
import {createStackNavigator} from '@react-navigation/stack';
import {createMaterialBottomTabNavigator} from '@react-navigation/material-bottom-tabs';


const Drawer = createDrawerNavigator();
const PrivateStack = createStackNavigator();
const ScheduleStack = createStackNavigator();
const MaterialBottomTabs = createMaterialBottomTabNavigator();

const PrivateStackScreen = ({navigation}) =>(
  <PrivateStack.Navigator screenOptions={{
    headerStyle:{
      backgroundColor:'#1167b1',
    },
    headerTintColor:'#fff',

  }}>
  <PrivateStack.Screen name="Private" component={Privatescreen}
    options={{
      title:'Private',
      headerLeft:() =>(
      <FontAwesome.Button name="bars" size={25}
      backgroundColor="#1167b1" onPress={()=> navigation.openDrawer()}/>
    )

    }}
  />
  </PrivateStack.Navigator>
)
// const ShareStackScreen = ({navigation}) =>(
//   <ShareStack.Navigator screenOptions={{
//     headerStyle:{
//       backgroundColor:'#1167b1',
//     },
//     headerTintColor:'#fff',

//   }}>
//   <ShareStack.Screen name="Share Car" component={Sharescreen}
//     options={{
//       title:'Share Car',
//       headerLeft:() =>(
//       <FontAwesome.Button name="bars" size={25}
//       backgroundColor="#1167b1" onPress={()=> navigation.openDrawer()}/>
//     )
//     }}
//   />
//   </ShareStack.Navigator>
// )

const ScheduleStackScreen = ({navigation}) =>(
  <ScheduleStack.Navigator screenOptions={{
    headerStyle:{
      backgroundColor:'#1167b1',
    },
    headerTintColor:'#fff',

  }}>
  <ScheduleStack.Screen name="Schedule" component={ScheduleScreen}
    options={{
      title:'My Schedules',
      headerLeft:() =>(
      <FontAwesome.Button name="bars" size={25}
      backgroundColor="#1167b1" onPress={()=> navigation.openDrawer()}/>
    ),
    }}
  />
  </ScheduleStack.Navigator>
)
export default class Tabscreen extends Component {
render(){ 

  createBottomTabs = () => 
    <MaterialBottomTabs.Navigator initialRouteName="Profile">
        <MaterialBottomTabs.Screen 
        name="Profile" 
        component={Profilescreen}
        options={{
          tabBarLabel: 'Profile',
          tabBarIcon: ({ color }) => (
            <MaterialCommunityIcons name="account" color={color} size={26} />
            ),
        }} />

        <MaterialBottomTabs.Screen 
        name="Ride" 
        component={PrivateStackScreen}
        options={{
          tabBarLabel: 'Private',
          tabBarIcon: ({ color }) => (
            <MaterialCommunityIcons name="car" color={color} size={26} />
            ),
        }} />
        <MaterialBottomTabs.Screen 
        name="Share" 
        component={Sharescreen}
        options={{
          tabBarLabel: 'Share',
          tabBarIcon: ({ color }) => (
            <FontAwesome name="users" color={color} size={22} />
            ),
        }} />
        <MaterialBottomTabs.Screen 
        name="Schedule" 
        component={ScheduleStackScreen} 
        options={{
          tabBarLabel: 'Home',
          tabBarIcon: ({ color }) => (
            <MaterialCommunityIcons name="home" color={color} size={27} />
            ),
        }}
        />
        <MaterialBottomTabs.Screen 
        name="Notification" 
        component={Notification}
        options={{
          tabBarLabel: 'Notification',
          tabBarIcon: ({ color }) => (
            <MaterialCommunityIcons name="bell" color={color} size={26} />
            ),
        }}/>

    </MaterialBottomTabs.Navigator>


  // createHomeStack = () =>
  //   <Stack.Navigator>
  //       <Stack.Screen name="Profile" children={createBottomTabs} />
  //       {/* <Stack.Screen name="Notification" component={Notification} />
  //       <Stack.Screen name="Private" component={Privatescreen} />
  //       <Stack.Screen name="Schedule" component={ScheduleScreen} />
  //       <Stack.Screen name="Share" component={Sharescreen} />    */}
  //   </Stack.Navigator>


  return(
    <NavigationContainer>
      <Drawer.Navigator  drawerContent={props => <DrawerContent {...props} />}>

        <Drawer.Screen name = "Home" children={createBottomTabs}/>
        <Drawer.Screen name = "Profile" component = {Profilescreen}/>
        <Drawer.Screen name = "Schedule" component = {ScheduleStackScreen}/>
        <Drawer.Screen name = "Settings" component = {ScheduleScreen}/>

      </Drawer.Navigator>
    </NavigationContainer>

  );
}

}
